import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack'; // Change import
import Home from './components/Home';
import DurationExercise from './components/DurationExercise';
import RepetitionExercise from './components/RepetitionExercise';

const Stack = createStackNavigator(); // Use createStackNavigator from @react-navigation/stack/native

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={Home} />
        <Stack.Screen name="DurationExercise" component={DurationExercise} />
        <Stack.Screen name="RepetitionExercise" component={RepetitionExercise} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
